import style from "./Courses.module.css";

function coursesMenu(props) {
  console.log(props);
  if (props.userCourses !== "") {
    return (
      <div className={style.container}>
        <div>
          {props.userCourses.map((p) => (
            <div key={p.id}>
              <div>{p.courseName}</div>
              <div>
                {props.userCourses.steps.map((j) => (
                  <div key={j.id}>
                    <div>{j.stepTitle}</div>
                    <div>{j.stepType}</div>
                    <div>{j.stepContent}</div>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>
    );
  } else {
    return <div>Чет хуйня какая-то</div>;
  }
}
export default coursesMenu;
